// import logo from './logo.svg';
import "./App.css";

function App() {
  return (
    <main>
      <article>test</article>
      <article>
        <h1>Hamburger App</h1>
        <ol>
          <li>Wake Up at 08:00 </li>
          <li>Clean My room 3h </li>
          <li>Do My homework 3h 20m </li>
          <li>Test comment 2h 1m </li>
          <li>Sleep at 01:00 </li>
          <img
            src="data:image/png;base64,"
            alt="ingredient"
          />
        </ol>
      </article>
    </main>
  );
}

export default App;
